    describe('multiRouter.MultiRouteModel manual service mode', function () {
        function makeJsonAnswer (wayPointName) {
            return { type: 'FeatureCollection', features: [
                { /* Way points */ type: 'FeatureCollection', features: [
                    { type: 'Feature',
                        properties: { index: 0, name: wayPointName },
                        geometry: { type: "Point", coordinates: [0, 0] }
                    }
                ] },
                { /* Via points */ type: 'FeatureCollection', features: [] },
                { /* Routes */ type: 'FeatureCollection', features: [] }
            ] };
        }

        it('should not fire initial requestchange', function (done) {
            var model = new MultiRouteModel(['a', 'b'], { serviceMode: 'manual' });
            var events = util.sniffEvents(model.events);

            util.waitEventOnce(model.events, 'requestchange')
                .timeout(50)
                .then(
                    function () { expect().fail('initial requestchange should not be sent'); },
                    function (e) { expect(e.message).to.be('timed out'); })
                .then(done, done);
        });

        it('should allow to set json via setStateAsync', function (done) {
            var model = new MultiRouteModel(['a', 'b'], { serviceMode: 'manual' });
            var events = util.sniffEvents(model.events);

            model.setStateAsync(makeJsonAnswer('a'))
                .then(function () {
                    expect(model.getWayPoints()[0].properties.get('name')).to.be('a');
                    expect(events).to.eql(['jsonchange', 'update']);
                })
                .then(done, done);
        });

        it('should allow to set json, reference points and params via setStateAsync without changing request', function (done) {
            var model = new MultiRouteModel(['a', 'b'], { serviceMode: 'manual' });
            var events = util.sniffEvents(model.events);

            model.setStateAsync(makeJsonAnswer('xxx'), ['xxx', 'yyy'], { routingMode: 'masstransit' })
                .then(function () {
                    expect(model.getReferencePoints()).to.eql(['xxx', 'yyy']);
                    expect(model.getParams().routingMode).to.be('masstransit');
                    expect(model.getWayPoints()[0].properties.get('name')).to.be('xxx');

                    expect(events).to.eql(['jsonchange', 'update']);
                })
                .then(done, done);
        });

        it('should allow to try update json synchroniously', function () {
            var model = new MultiRouteModel(['a', 'b'], { serviceMode: 'manual' });
            var events = util.sniffEvents(model.events);

            expect(model.setStateSync(makeJsonAnswer('aaa'), ['aaa', 'bbb'], { routingMode: 'auto' })).to.be(false);

            return model.setStateAsync(makeJsonAnswer('aaa'), ['aaa', 'bbb'], { routingMode: 'auto' }).then(function () {
                expect(model.setStateSync(makeJsonAnswer('xxx'), ['xxx', 'yyy'], { routingMode: 'masstransit' })).to.be(true);

                expect(model.getReferencePoints()).to.eql(['xxx', 'yyy']);
                expect(model.getParams().routingMode).to.be('masstransit');
                expect(model.getWayPoints()[0].properties.get('name')).to.be('xxx');

                expect(events).to.eql(['jsonchange', 'update', 'jsonchange', 'update']);
            });
        });

        it('should not make calls to router service', function (done) {
            var routeStub = sinon.stub(multiRouterService, 'route');
            routeStub.returns(vow.reject(new Error('Router service should not be called')));

            var model = new MultiRouteModel(['a', 'b'], { serviceMode: 'manual' });
            var events = util.sniffEvents(model.events);

            vow.delay(null, 100)
                .then(function () {
                    model.setReferencePoints(['b', 'c']);
                    return vow.delay(null, 100);
                })
                .then(function () {
                    expect(events).to.eql(['requestchange']);
                    expect(routeStub.callCount).to.be(0);
                })
                .then(done, done);
        });

        it('should fire requestchange on each update of reference points or params', function (done) {
            var model = new MultiRouteModel(['a', 'b', 'c'], {
                serviceMode: 'manual',
                routingMode: 'pedestrian'
            });

            var events = util.sniffEvents(model.events);

            var promise = util.waitEventOnce(model.events, 'requestchange').timeout(10);
            model.setParams({ routingMode: 'masstransit' });
            promise
                .then(function (e) {
                    expect(e.get('referencePoints')).to.eql(['a', 'b', 'c']);
                    expect(e.get('oldReferencePoints')).to.eql(['a', 'b', 'c']);

                    expect(e.get('params').routingMode).to.be('masstransit');
                    expect(e.get('oldParams').routingMode).to.be('pedestrian');

                    var promise = util.waitEventOnce(model.events, 'requestchange').timeout(10);
                    model.setReferencePoints(['b', 'c', 'd']);
                    return promise;
                })
                .then(function (e) {
                    expect(e.get('referencePoints')).to.eql(['b', 'c', 'd']);
                    expect(e.get('oldReferencePoints')).to.eql(['a', 'b', 'c']);

                    expect(e.get('params').routingMode).to.be('masstransit');
                    expect(e.get('oldParams').routingMode).to.be('masstransit');
                })
                .then(function () {
                    expect(events).to.eql(['requestchange', 'requestchange']);
                })
                .then(done, done);
        });

        it('should apply setStateAsync changes sequentially', function (done) {
            var model = new MultiRouteModel(['a', 'b', 'c'], {
                serviceMode: 'manual',
                routingMode: 'pedestrian'
            });

            var events = util.sniffEvents(model.events);

            var order = [];
            vow.all([
                model.setStateAsync(makeJsonAnswer('a')).then(function () { order.push('a'); }),
                model.setStateAsync(makeJsonAnswer('b')).then(function () { order.push('b'); }),
                model.setStateAsync(makeJsonAnswer('c')).then(function () { order.push('c'); }),
                model.setStateAsync(makeJsonAnswer('d')).then(function () { order.push('d'); }),
                util.waitEventCount(model.events, 'update', 4)
            ])
                .then(function () {
                    expect(model.getWayPoints()[0].properties.get('name')).to.equal('d');
                    expect(order).to.eql(['a', 'b', 'c', 'd']);
                    expect(events).to.eql([
                        'jsonchange', 'update',
                        'jsonchange', 'update',
                        'jsonchange', 'update',
                        'jsonchange', 'update'
                    ]);
                })
                .then(done, done);
        });
    });

    provide();
